function jsonStringifyRecursive(obj) {
  const cache = new Set();
  return JSON.stringify(obj, (key, value) => {
      if (typeof value === 'object' && value !== null) {
          if (cache.has(value)) {
              // Circular reference found, discard key
              return;
          }
          // Store value in our collection
          cache.add(value);
      }
      return value;
  }, 4);
}

  if (!server || !server?.kernel) {
    console.log('no evaluation kernel available, trying master...');

  } else {
    if (!server.kernel.connected) {

      data = await server.getSymbol(name); //get the data
    } else {

    }

  console.log('got');
  //console.log(data);

  if (symbolQ) {
    if (data.charAt(0) == "'") symbolQ = false;
    if (isNumeric(data)) symbolQ = false;
  }

  //interpretate it AGAIN!
  return interpretate(d, org);

core.Offload = (args, env) => {
  if (args.length > 1) {
      //alternative path - checking options
      //do it in ugly superfast way
      if (args[1][1] === "'Static'") {
          if (args[1][2]) {
              return interpretate(args[0], {...env, static: true});
          }
      } else if (args.length > 2) {
          if (args[2][1] === "'Static'") {
              if (args[2][2]) {
                  return interpretate(args[0], {...env, static: true});
              }                
          }
      }
  }

  return interpretate(args[0], env);
}

core.Offload.update = (args, env) => {
  if (args.length > 1) {
      //alternative path - checking options
      //do it in ugly superfast way

      //Volitile -> False -> Reject updates

      //low-level optimizations, we dont' need to spend time on parsing options
      if (args[1][1] === "'Volatile'") {
          if (!args[1][2]) {
              console.log('Update was rejected (Nonvolatile)');
              return;
          }
      } else if (args.length > 2) {
          if (args[2][1] === "'Volatile'") {
              if (!args[2][2]) {
                  console.log('Update was rejected (Nonvolatile)');
                  return;
              }                
          }
      }
  }

  return interpretate(args[0], env);
}

  let result = [];

    if (arr.length === 0) {

    } else {
      for (let i = 0; i < arr.length; i++) {
        let curr = arr.slice();
        let next = curr.splice(i, 1);
        permute(curr.slice(), m.concat(next));

class KernelState {
  state = {}
  hash = ''
  
  constructor (state = undefined, ev, ffast = false) {
    if (state) this.state = {...state.state};
    const code = String(ev.uid) + String(ev.pattern);
    this.state[code] = ev.data;
    const self = this;
    if (ffast) {
      this.hash = [Object.keys(this.state)].map((variant) => variant.reduce((acc, e) => {
        const h = 'dt'+String(self.state[e]) + 'st'+String(e);
        return acc + h;
      }, 0));

      return this;
    }

    this.hash = permutator(Object.keys(this.state)).map((variant) => variant.reduce((acc, e) => {
      const h = 'dt'+String(self.state[e]) + 'st'+String(e);
      return acc + h;
    }, 0));


    return this;
  }

  match(state) {
    for (const prop of Object.keys(this.state)) {
      if (state[prop] != this.state[prop]) return false;
    }

    return true;
  }
  
  set (o, m, opts = {}) {
    let found = false;

    for (const h of this.hash) {
      if (m.has(h)) {
        found = h;
        break;
      }
      
    }

    let object;

    if (!found) {
      object = {$state: this.state};
      found = this.hash[0];
      m.set(found, object);
      for (let k = 1; k<this.hash.length; ++k) {
        if (m.has(this.hash[k])) {
          console.error('COLLISION!');
          console.warn(m.get(this.state));
          const fwd = m.get(this.hash[k]);
          console.warn(fwd);
          if (!fwd.$collided) fwd.$collided = [];
          const extra = {};
          fwd.$collided.push(extra);
          extra.$state = this.state;
          extra.fwd = found;
          continue;
        }
        m.set(this.hash[k], {fwd: found, $state: this.state});
      }
    } else {
      object = m.get(found);
      if (!this.match(object.$state)) {
        console.warn('Collision!');
        if (!object.$collided) object.$collided = [];
        const extra = {};
        object.$collided.push(extra);
        extra.$state = this.state;
        object = extra;
      }
    }
    

    //object.state = {...this.state};//debug only
    if (opts.noduplicates) {
      object[o.name] = {set:[o.data], i:0};
      return this;
    }

    if (o.name in object) {
      object[o.name].set.push(o.data);
    } else {
      object[o.name] = {i:0, set:[o.data]}; 
    }
  }
  
  exec (m, fn) {
    let h = this.hash[0];
    while(m.has(h)) {
      let o = m.get(h);

      if (!this.match(o.$state)) {
        console.warn('COLLISION!');
        console.warn(o);
        console.warn(this);
        o = object.$collided.find((el) => this.match(el.$state));
      }

      if (o.fwd) {
        h = o.fwd;
        continue;
      }

      //console.warn(this.state);
      //console.warn(o);

      return fn(o)
    }

    console.error('State does not exists!');
    console.log(this.state);
    console.log(this.hash);
  }
}

const eventNameToString = (ev) => (String(ev.uid) + String(ev.pattern));

class KernelMesh {
    constructor(group, database) {
      this.database = database;
      this.whitelist = Object.keys(group.eventObjects);
      return this;
    }
    
    test(msg) {
  
      return this.whitelist.includes(eventNameToString(msg));
    }
    
    serialize() {
      return JSON.stringify({db:Object.fromEntries(this.database), wl:this.whitelist});
    }
    
    static unpack(string) {
      const data = JSON.parse(  string );
      const wlKeys = {};
      data.wl.forEach((k) => wlKeys[k] = true);

      const o = new KernelMesh({eventObjects: wlKeys}, new Map(Object.entries(data.db)));
      return o;
    }
}

              emitt: () => {},
              kernel: {}
            }   

            window.server.kernel.emitt = function(uid, data, type = 'Default') {
              setTimeout(() => {
                const message = {type: 'event', uid: uid, pattern: type, data:data};
                const kernels = window._kernels;

                for (let i=0; i<kernels.length; ++i) {
                  if (!kernels[i].test(message)) continue;

                  if (!kernels[i].state) {
                    if (kernels[i].database.has('$initialization')) {
                      const init = kernels[i].database.get('$initialization');
                      init.forEach((ie) => kernels[i].state = new KernelState(kernels[i].state, ie, true));
                    } 
                    
                    kernels[i].state = new KernelState(kernels[i].state, message, true);

                  } else {
                    kernels[i].state = new KernelState(kernels[i].state, message, true);
                  }

                  kernels[i].state.exec(kernels[i].database, (fn) => {
                    for (const f of Object.keys(fn)) {
                      if (f === '$state') continue;

                      if (fn[f].set.length === 1) {       
                        core[f].data = fn[f].set[0];
                        for (const inst of Object.values(core[f].instances)) {
                          inst.update();
                        };
                      } else {
                        fn[f].i += 1;
                        if (fn[f].i >= fn[f].set.length) fn[f].i = 0;
                        core[f].data = fn[f].set[fn[f].i];
                        for (const inst of Object.values(core[f].instances)) {
                          inst.update();
                        };
                      }
                    }
                  });
                }
              }, 2);
            }</script><script type="module"> const controls = (opts) => {
